import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell } from '@fortawesome/free-solid-svg-icons';
import gg from '../../uss.png'; // Adjust the path to point to the root directory
import logo from '../../uss.png'; // Adjust the path to point to the root directory

function AppHeader() {
    return (
        <div className="AppHeader" style={{ display: 'flex', alignItems: 'center', padding: '10px' }}>
            <img src={logo} alt="logo" style={{ height: '100px' }} />
            <div style={{ marginLeft: 'auto', display: 'flex', alignItems: 'center' }}>
                <FontAwesomeIcon icon={faBell} style={{ marginRight: '20px', cursor: 'pointer', fontSize: '24px' }} />
                <img src={gg} alt="logo" style={{ height: '50px', width: '50px', borderRadius: '50%' }} />
            </div>
        </div>
    );
}

export default AppHeader;
